import React from 'react';
import "../styles/card.css";

function Card() {
    return (
        <div className="col-3">
            <div class="card shadow mb-5">
                <img class="card-img-top" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRZ-GUaSRg3bC5hMGqdH7yOoW7wSxAnM2CM8dix8-vVisIwIpdn&s"></img>
            </div>
        </div>
    );
  }

  export default Card;
